import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Main.css"; 

function Main() {
  const navigate = useNavigate(); 
  const [userData, setUserData] = useState(null); // State to hold user data

  // Fetch user data when the component mounts
  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const response = await fetch('/getUserInfo', {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
            // No authorization token is included here
          },
        });

        if (!response.ok) {
          throw new Error('Failed to fetch user data');
        }

        const data = await response.json();
        setUserData(data); // Set user data in state
      } catch (error) {
        console.error('Error fetching user data:', error);
        // Optionally handle error (e.g., redirect to login)
        navigate("/");
      }
    };

    fetchUserData();
  }, [navigate]);

  // Function for logout
  const handleLogout = () => {
    localStorage.removeItem("isAuthenticated"); // Clear authentication status
    // Redirect to login page
    navigate("/");
  };

  // Handle the case where userData has not been fetched yet
  if (!userData) {
    return <div>Loading...</div>; // Show loading state while fetching user data
  }

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <div className="sidebar">
        <p className="sidebar-address">Podivínska 12 Košice</p>
        <nav className="nav-links">
          <a href="#" className="nav-item">
            <div className="nav-icon">
              <img src="./Home.svg" alt="Home Icon" className="add-icon" />{" "}
            </div>
            <span>Home</span>
          </a>
          <a href="?" className="nav-item">
            <div className="nav-icon">
              <img
                src="./Calendar.svg"
                alt="Calendar Icon"
                className="add-icon"
              />{" "}
            </div>
            <span>Kalendár</span>
          </a>
        </nav>
      </div>

      <div className="main-content">
        <div className="header">
          <span>{userData.meno} {userData.priezvisko}</span>
          <span>{userData.cislo_bytu}</span>
          <button className="logout-button" onClick={handleLogout}>
            Log out
          </button>
        </div>

        <div className="dashboard-body">
          <div className="account-box">
            <div className="account-header">
              <h3>Stav uctu: 5824,58€</h3>
              <button className="add-btn">
                <img src="./Add.svg" alt="User Icon" className="add-icon" />{" "}
              </button>
            </div>
            <hr />
            <div className="account-graph">TU GRAF xdd</div>
          </div>

          <div className="tasks-box">
            <h3>Práce tento mesiac</h3>
            <hr />
            <table>
              <thead>
                <tr>
                  <th>Upratovanie</th>
                  <th>Kosenie/Sneh</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>Adam P.</td>
                  <td>Monika Z.</td>
                </tr>
                <tr>
                  <td>Maroš G.</td>
                  <td>Erik L.</td>
                </tr>
                <tr>
                  <td>Slávo V.</td>
                  <td>Michal K.</td>
                </tr>
                <tr>
                  <td>Daniela M.</td>
                  <td>Juraj F.</td>
                </tr>
              </tbody>
            </table>
          </div>

          <div className="voting-box">
            <div className="voting-header">
              <h3>Posledné hlasovanie</h3>
              <button className="add-btn">
                <img src="./Add.svg" alt="User Icon" className="add-icon" />{" "}
              </button>
            </div>
            <hr />
            <ul className="voting-results">
              <li>Za: 4</li>
              <li>Proti: 2</li>
              <li>Nezucastnilo sa: 7</li>
            </ul>
          </div>

          <div className="problems-box">
            <div className="problems-header">
              <h3>Problémy</h3>
              <button className="add-btn">
                <img src="./Add.svg" alt="User Icon" className="add-icon" />{" "}
              </button>
            </div>
            <hr />
            <ul className="problems-list">
              <li>Svetlo vo výťahu nesvieti</li>
              <li>Nezvládam to psychicky</li>
              <li>Smrad v kočikárni</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Main;
